import { Row,Col } from 'react-bootstrap';
import './App.css';
import Hasil from './components/Hasil';
import ListCategori from './components/ListCategori';
import NavbarComponent from './components/NavbarComponent';

function App() {
  return (
    <div className="App">
      <NavbarComponent/>
      <Row>
        <ListCategori />
        <Col>
          <h4><strong>Daftar Produk</strong></h4>
          <hr />
        </Col>
        <Hasil/>

        <hr/>
      </Row>
    </div>
  );
}

export default App;
